import style from "./About.module.css";

function About() {
    return (
    <div className={style.container}>

        <h1 className={style.title}>Bienvenido al primer proyecto de Pablo Perez :)</h1>

        <h2 className={style.text}>1232323</h2>

        <h2 className={style.text}>2554545</h2>

        <h2 className={style.text}>37676767</h2>

        <h2 className={style.text}>48998989</h2>

    </div>
    )
}

export default About;
